import { gql } from 'apollo-boost'

const addBookMutation = gql`
  mutation AddBook($name: String, $genre: String, $authorId: ID) {
    addBook(name: $name, genre: $genre, authorId: $authorId) {
      name
      id
    }
  }
`
const signup = gql`
  mutation signup(
    $firstname: String
    $lastname: String
    $email: String
    $password: String
  ) {
    signup(
      firstname: $firstname
      lastname: $lastname
      email: $email
      password: $password
    ) {
      firstname
      lastname
    }
  }
`
const signupowner = gql`
  mutation signupowner(
    $firstname: String
    $lastname: String
    $email: String
    $password: String
    $restaurant: String
    $cuisine: String
  ) {
    signupowner(
      firstname: $firstname
      lastname: $lastname
      email: $email
      password: $password
      restaurant: $restaurant
      cuisine: $cuisine
    ) {
      firstname
      lastname
      restaurant
      cuisine
      isOwner
    }
  }
`
const addsection = gql`
  mutation addsection($email: String, $sectionName: String) {
    addsection(email: $email, sectionName: $sectionName) {
      sections {
        name
      }
    }
  }
`
const additem = gql`
  mutation additem(
    $email: String
    $sectionId: String
    $itemName: String
    $itemDescription: String
    $itemPrice: String
  ) {
    additem(
      email: $email
      sectionName: $sectionName
      itemName: $itemName
      itemDescription: $itemDescription
      itemPrice: $itemPrice
    ) {
      firstname
      id
    }
  }
`
const updateprofile = gql`
  mutation updateprofile(
    $firstname: String
    $lastname: String
    $email: String
    $password: String
  ) {
    updateprofile(
      firstname: $firstname
      lastname: $lastname
      email: $email
      password: $password
    ) {
      firstname
      lastname
      email
      password
    }
  }
`

export {
  addBookMutation,
  signup,
  updateprofile,
  signupowner,
  addsection,
  additem
}
